import React, { useState, useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import isEmpty from 'lodash.isempty'

import { Developer } from '../components'
import { sessionDeleteRequest } from '../store/sessions/actions'
import { getJobsRequest, jobCreateRequest, jobDeleteRequest } from '../store/jobs/actions'
// import { history } from '../../services'

// const initialState = {
//   email: '',
//   password: ''
// }

export const DeveloperContainer = () => {
  const dispatch = useDispatch()

  const [selectedProject, setSelectedProject] = useState(null)
  const [selectedCategory, setSelectedCategory] = useState(null)
  const [value, setValue] = useState('')
  const [startDate, setStartDate] = useState(new Date())

  const { data } = useSelector(state => state.sessions)
  const { jobsData } = useSelector(state => state.jobs)

  useEffect(() => {
    dispatch(getJobsRequest(`jobs?${startDate}`))
  }, [])

  // const handleChange = (key, text) => {
  //   setValue({...value, [key]: text})
  //   // errorsState[key] && setErrorsState({...errorsState, [key]: ''})
  // }

  // useEffect(() => {
  //   if (!isEmpty(data)) {
  //     console.log('wedfwedwedf')
  //   }
  // }, [data])

  const logOut = () => {
    dispatch(sessionDeleteRequest('authentications'))
  }

  const handleChange = (e) => {
    const financialGoal = (e.target.validity.valid) ? e.target.value : value
    setValue(financialGoal)
  }

  const create = () => {
    const sendData = { name: selectedProject.value, category: selectedCategory.value, hours: value, user_id: data.user.id }
    dispatch(jobCreateRequest('jobs', sendData))
  }

  const remove = id => {
    dispatch(jobDeleteRequest(`jobs/${id}`))
  }

  return (
    <Developer
      logOut={ logOut }
      user={ data.attributes }
      selectedProject={ selectedProject }
      setSelectedProject={ setSelectedProject }
      selectedCategory={ selectedCategory }
      setSelectedCategory={ setSelectedCategory }
      setValue={ setValue }
      value={ value }
      handleChange={ handleChange }
      create={ create }
      jobsData={ jobsData }
      remove={ remove }
      startDate={ startDate }
      setStartDate={ setStartDate }
    />
  )
}
